  return (
    <main className="container-sm text-center d-flex flex-column">
        <iframe src="https://www.google.com/maps/d/embed?mid=1xUGTfW2q5ZBIBrT8XbRs6Gd_v4I&hl=es-419&ehbc=2E312F" width="100%" title="Mapa" height="480"></iframe>
    </main>
  );
}

export default MainMapa;
